import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, Touchable, View } from 'react-native';
import { Button, SafeAreaView, ScrollView, TextInput, TouchableOpacity } from 'react-native-web';
import { useState } from 'react';

export default function Segunda({ navigation }) {
  const produtos = [
    {
      "nomeprod": "Detergente",
      "preco": 1.75,
      "descricao":{
        "marca":"Ype",
        "sabor":"Maçã"
      }
    },
    {
      "nomeprod": "Bucha",
      "preco": 6.50,
      "descricao":{
        "marca":"Assolam",
        "sabor":"Morte"
      }
    },
    {
      "nomeprod": "Sabão em Barra",
      "preco": 3.50,
      "descricao":{
        "marca":"Ype",
        "sabor":"Coco"
      }
    }
  ]

  return (
    <View>
      <Text>Mingau</Text>
      <Button title="Navegar" onPress={() => {navigation.navigate('Home', {"cod": 12})}}></Button>
    </View>
  );
}
